V8:
İlkin ödəniş 15 min manat.

Binəqədi r.7-ci mikrorayon q.
Ünvan: Bakı şəhəri, Abay Kunanbayev küçəsi 135A
"Modern Park" – müasir standartlara cavab verən yaşayış kompleksidir.

- Kompleks Bakı şəh., Binəqədi r-nu, 7-ci mkr., Abay Kunanbayev küç. 135a ünvanında (keçmiş ABU-nun yaxınlığı) – "Azadlıq Prospekti" m/st-na 1200 m, "Dərnəgül" m/st-na 1100 m, avtobus dayanacağına 100 m, məktəb, uşaq bağçası və ticarət obyektlərinə 150 m məsafədə yerləşir.

- Kompleksin ümumi sahəsi – 1,03 hektar (tikinti sahəsi – 20%, həyətyanı sahə – 8000 m²);

- Mənzillər 1, 2 və 3 otaqlıdır, təmirsizdir;
Bina 3 blokdan ibarətdir: 2 blok – hər biri 15 mərtəbə, 1 blok isə – 17 mərtəbə;

- Qiymətlər: Nağd 1200 AZN, daxili kredit 1300 AZN;

- İlkin ödəniş 30% olmaqla 36 aya qədər daxili kredit imkanları;

- İlkin ödəniş 30%, müddət 120-240 ay, illik faiz dərəcəsi 10% olan kredit imkanları;

- Bina istifadəyə verildikdə daimi qaz, su, işıq və çıxarış ilə təmin olunacaq;

- Bina 2 mərtəbəli yeraltı avtomobil dayanacağına, qapalı və 24 saat mühafizə olunan geniş həyətyanı sahəyə, sakinlər üçün gəzinti və velosiped zolaqlarına, uşaqların əyləncəsi üçün stadiona və digər üstünlüklərə malik olacaq;

-İstədiyiniz otaq sayına uyğun mənzillərin layihələrini sizə göndərə bilərik.

- Kompleksin tikintisi 2021-ci ilin oktyabr ayında başlayıb.

-2023-cü ilin oktyabr ayında kompleks təhvil veriləcək.

-59.5 kv.m metr olan bu mənzili studio iki otaq etmək də mümkündür. Həmin layihə fotolar bölümündə yerləşdirilib
